import React from 'react';
import SectionHeader from '../SectionHeader';
import Project from './project';

const Projects = (props) => {

    const getImage = (image) => {
        return(<div class="carousel-item active">
        <img class="d-block w-100" src={image} alt="First slide"></img>
      </div>)
    }
    const GetImages = () => {
        var images;
        if(props.images != null){
            for(var i = 0; i < props.images.length; i++){
                images += getImage(props.images[i]);
            }
            console.log(images);
            return getImage;
        }
    }
    return (
        <div>
            <SectionHeader h1="Pig Gallery" h3="“If you are working on something that you really care about, you don’t have to be pushed. The vision pulls you.” – Steve Jobs" />
            <div id="carouselExampleControls" class="carousel slide" data-ride="carousel">
  <div class="carousel-inner">
    {GetImages()}
  </div>
  <a class="carousel-control-prev" href="#carouselExampleControls" role="button" data-slide="prev">
    <span class="carousel-control-prev-icon" aria-hidden="true"></span>
    <span class="sr-only">Previous</span>
  </a>
  <a class="carousel-control-next" href="#carouselExampleControls" role="button" data-slide="next">
    <span class="carousel-control-next-icon" aria-hidden="true"></span>
    <span class="sr-only">Next</span>
  </a>
</div>
        </div>
    )
}

export default Projects
